    true,nt"url": null,nt"notes": "<p>The Total Product Life Cycle (TPLC) database
    integrates premarket and postmarket data about medical devices. It includes information
    pulled from CDRH databases including Premarket Approvals (PMA), Premarket Notifications
    (510[k]), Adverse Events, and Recalls. You can search the TPLC database by device
    name or procode to receive a full report about a particular product line.</p>n",nt"license_title":
